import React from "react";
import 'font-awesome/css/font-awesome.min.css';


export default class UserPost extends React.Component{
    constructor(props) {
        super(props);

      }

    render(){
        return <div>
            <div className="card">
                    <div className="card-body">
                        <h1 className="card-title">{this.props.title}</h1>
                        <p className="text-muted">{this.props.content}</p>
                        <span>Published at:</span><strong> {this.props.pubAt}</strong>
                    <i className="fa fa-like"/><p>  Likes: {this.props.likes}</p>
                    <strong>Tags:</strong>{this.props.tags.map(tag =>tag+",")}<br/>
                    <a href="#like" className="btn btn-danger btn-sm ml-0">Remove</a>
                    </div>
                </div>
        </div>
    }
}
